function extractImageUrls() {
    try {
        const scrapeData = $('Scrape Rapid API').all();

        // Check if all required properties exist in the path
        if (!scrapeData?.[0]?.json?.data?.initialReduxState?.propertyDetails?.photos) {
            return []; // Return empty array if photos don't exist
        }

        const photos = scrapeData[0].json.data.initialReduxState.propertyDetails.photos;
        return photos.map(photo => ({
            href: photo.href
        }));
    } catch (error) {
        // Return empty array in case of any errors
        return [];
    }
}

return extractImageUrls();
